import React from "react";

const Home = () => {
  return (
    <section className="min-h-screen flex items-center justify-center text-center px-4 pt-20" id="home">
      <div className="max-w-3xl">
        <h2 className="text-4xl md:text-6xl font-semibold leading-tight mb-6">
          Hello, I'm <span className="text-blue-500">Your Name</span>
        </h2>
        <p className="text-lg text-gray-600 mb-8">
          I design and build digital experiences. Front-end developer & UI/UX enthusiast.
        </p>
        <a
          href="#projects"
          className="inline-block px-6 py-3 bg-black text-white rounded-full text-sm hover:bg-gray-800 transition"
        >
          View Work
        </a>
      </div>
    </section>
  );
};

export default Home;
